import React,{useState,useEffect} from "react";
//import React Router Links
import {Link} from 'react-router-dom';
//import background 


const data={
    menus:[
        {
            title:"Why Saleswhale",
            links:[
                {label:"Collaborative Intelligence",href:'#'},
                {label:"AI Assistant Capabilities",href:'#'},
                {label:"Customer Stories",href:'#'},
                {label:"Use Case - Technology",href:'#'},
                {label:"Use Case - Education",href:'#'},
                {label:"Use Case - Events",href:'#'},
            ]
        },
        {
            title:"Products",
            links:[
                {label:"AI Conversations",href:'#'},
                {label:'Lead Enrichment',href:'#'},
                {label:"Deal Intelligence",href:'#'},
                {label:"Workflow Integration",href:'#'},
            ]
        },
        {
            title:"Company",
            links:[
                {label:"About Us",href:'#'},
                {label:'Blog',href:'#'},
                {label:"Resources",href:'#'},
                {label:"Careers",href:'#'},
                {label:"Help Center",href:'#'},
            ]
        }
        ],
    contactUs:{
        email:{
            title:"Contact",
            content:'hello@saleswhale.com'
        },
        offices:[
            {
                title:'',
                content:''
            },
            {
                title:'',
                content:''
            }
        ]
    }
}

function LinkMenu({title,links}){
    return(
        <nav className="nav flex-column">
        <h3 className='nav-body nav-text h5 p-0 font-weight-bold'>{title}</h3>

        {links.map(link=>{
            const {label,href}=link; 
            return(
                <Link className='nav-link text-dark' to={href}>{label}</Link>
            )
        })}

        </nav>
    )
}

export default function Footer(){
    //state for mock JSON Data 
    const [info,setInfo]=useState(null);

    //useEffect for initial canvas pint lifecycle
    useEffect(()=>{
        setInfo(data)
    },[])

    //Loading component if JSON data is still being loaded. 
    if(!info) return <p>Loading... </p>

    //destructure JSON Data
    const{menus,contactUs}=data;

    return(
        <footer className='container-fluid'>
            <div className='row'>
                <img className="navbar-brand" src="https://www.saleswhale.com/hubfs/humpback/web/assets/svg/logos/sw-logo.svg" alt="Saleswhale logo"/>
                {menus.map(menu=>{
                    const {title,links}=menu;
                    return(
                        <LinkMenu
                            title={title}
                            links={links}
                        />
                    )
                })}

            </div>

            <div className='row'>

            </div>
        </footer>
    )
}
